import React, { Component } from 'react'

export default class Messages extends Component {
    render() {
        return (
            <div>
                  <h1> This is my Messages Page</h1>
                  <ul>
                      <li key="1">Message 1</li>
                      <li key="2">Message 2</li>
                      <li key="3">Message 3</li>
                  </ul>
            </div>
        )
    }
}
